import React from 'react'
import { useState } from 'react'
import './CSS/Knives.css'
import knives from '../Components/Assets/all_knifes'
import Item from '../Components/Knife/Knife'

export const Knives = () => {


  const [searchInput, setSearchInput] = useState("")
    const all_knives = knives
    const handleChange = (e) =>{
        e.preventDefault()
        setSearchInput(e.target.value)
    }
    if (searchInput.length > 0){
        all_knives.filter((knife) => {
            return knife.name.match(searchInput)
        })
    }

  return (
    <div className='knives'>
              <div className='searchbar'>
            <input type="text" placeholder="Search Here" onChange={handleChange} value={searchInput}/>
            <table>
                <tr>
                    <th>Knives</th>
                </tr>
                {all_knives.map((knife, index) =>{ 
                    <tr> 
                        <td> {knife.name}</td>
                        <td>{knife.skin}</td>
                    </tr>
                    })}
            </table>
            </div>
    <h1>All Knives</h1>
    <div className='all-knives'>
      {all_knives.map((item, i)=>{
        return <Item key={i} id={item.id} name={item.name} image={item.image} knife_price={item.knife_price}/>
      })}
    </div>

  </div>
  )
}
